import React, {useState} from 'react';

import '../../style/LearnSet.css';


function SetInfo() {

    let wordSet = {
        words: [
            {
                id: 1,
                part1: 'cat',
                part2: 'koshka'
            },
            {
                id: 2,
                part1: 'bog',
                part2: 'cobaka'
            }
        ],
        name: 'Domestic Animals', 
        description: 'Names of some most popular animals.'
    };

    return (
        <div>
            <h2>{wordSet.name}</h2>

        </div>  
    )
}

export default SetInfo;
